webpackJsonp([88366108355044],{478:function(t,e){t.exports={pathContext:{data:{number:20,file:"https://aphid.fireside.fm/d/1437767933/1532eacf-ac70-4afc-9432-dbcaaaa28600/0c90e048-3d0a-45c8-ba6b-2c0214d22d55.mp3",title:"#20 — «Поймать опенсорсера»",date:"2017-12-08",notes:{notes:"- <a class='podcast_time'>1:01</a> - Как становятся опенсорсерами просто решая проблемы, в чем тут боль, а в чем - кайф.\n- <a class='podcast_time'>6:50</a> - Можно ли зарабатывать на том, что лежит бесплатно, как Webpack стал бизнесом и что уже давно следует прикрутить к Гитхабу.\n- <a class='podcast_time'>12:58</a> - Зачем опенсорсеру Твиттер.\n- <a class='podcast_time'>19:18</a> - Как Богдан захватывает репозитории и что там должно быть чтобы в них завелась жизнь.\n- <a class='podcast_time'>25:03</a> - Webpack — красавчик? Чем он так ужасен изнутри и почему [RollupJS](https://rollupjs.org/) лучше.\n- <a class='podcast_time'>36:10</a> - Богдан рассказывает что побудило его мейнтейнить [DerivableJS](https://github.com/ds300/derivablejs) и чем он лучше [MobX](https://mobx.js.org/) и [Redux](https://redux.js.org/). Споры о хранении стейта.\n- <a class='podcast_time'>40:40</a> - [React-cosmos](https://react-cosmos.github.io/) — убийца [Storybook](https://storybook.js.org/).\n- <a class='podcast_time'>43:11</a> - Снова хвалим [DerivableJS](https://github.com/ds300/derivablejs) и ругаем [декораторы](https://habrahabr.ru/post/277021/) и классы.\n- <a class='podcast_time'>51:57</a> - Артур рассказывает про свой [offline плагин для Webpack](https://github.com/NekR/offline-plugin) и как [«offline first»](https://habrahabr.ru/post/160477/) захватит мир, где тут бизнес, а где — [UX](https://ru.wikipedia.org/wiki/%D0%9E%D0%BF%D1%8B%D1%82_%D0%B2%D0%B7%D0%B0%D0%B8%D0%BC%D0%BE%D0%B4%D0%B5%D0%B9%D1%81%D1%82%D0%B2%D0%B8%D1%8F).\n- <a class='podcast_time'>69:05</a> - В чем суть политики Apple по отношению к Safari и другим браузерам.\n- <a class='podcast_time'>69:56</a> - Зачем нужен [offline плагин](https://github.com/NekR/offline-plugin), почему нативные приложения весят так много и что такое [Service Worker](https://developer.mozilla.org/ru/docs/Web/API/Service_Worker_API).\n- <a class='podcast_time'>79:20</a> - Почему [React Native](https://facebook.github.io/react-native/) взлетает быстрее [PWA](https://developers.google.com/web/progressive-web-apps/). О войне между корпорациями на поле опенсорса, за деньги и разработчиков.\n\n[opencollective — площадка для сбора денег](https://opencollective.com/)\n\nПочему нужно делать пва и почему нейтив может быть не нужен: https://cloudfour.com/thinks/progressive-web-apps-simply-make-sense\n\nCreate Progressive Web App - https://github.com/developit/preact-cli\n\nКак ПВА помогли поднять конверсию бизнесу, увеличить количество пользователей. Кейсы разные. https://www.pwastats.com/\n\nКуда же без \"гитхабов\" ведущих: [Сережа](https://github.com/lapanoid), [Богдан](https://github.com/TrySound) и [Артур](https://github.com/nekr).\n\nТак же у нас есть telegram чат для обратной связи [@drinkcast](https://t.me/drinkcast)."},persons:[{id:"c2klaUeAUVm8symk6SU4KMS",slug:"artur-stolyar",name:"Артур",lastname:"Столяр",company:null,photo:{file:{url:"//images.ctfassets.net/ej3wzulnf8dw/3UnIv16uxa02WgMsIIyUoq/7c7cd7e13e93e8ebe09a3eb527674d24/xijBmvI__400x400.jpg"}}},{id:"c457aJsdlV6Y0uAuE42mOq6",slug:"bogdan-chadkin",name:"Богдан",lastname:"Чадкин",company:null,photo:{file:{url:"//images.ctfassets.net/ej3wzulnf8dw/UeLu4abrIAK62kkIkCgGC/4c8622a0dd047ff01e27cffef7f5b653/e55bd4Lu_400x400.jpg"}}},{id:"c64YZMKjf4kIqYGUOg0uCcg",slug:"sergey-lapin",name:"Сергей",lastname:"Лапин",company:"gamecredits.com",photo:{file:{url:"//images.ctfassets.net/ej3wzulnf8dw/4C1klB24j6sAAOuCi0yo40/ff0622108c9b66abbbf5bb5b744a7fe8/pqtnrTs0A8o.jpg"}}}],formatedDate:"8 дек. 2017"},id:6}}}});
